import React from "react";
import Footer from "./Footer";
import Header from "./Header";
import Nav from "./Nav";

interface Props {
  children: any;
}

const Layout = ({ children }: Props) => {
  return (
    <div>
      <Header />
      <Nav />
      <main>{children}</main>
      <Footer />
    </div>
  );
};

export default Layout;
